// Following.jsx
import React from 'react';

const Following = ({ following }) => (
  <div>
    <h3>Following</h3>
    <ul>
      {following.map(user => (
        <li key={user.id}>
          <a href={`/user/${user.id}`}>{user.name}</a>
        </li>
      ))}
    </ul>
  </div>
);

export default Following;
